const Faq = () => (
    <div className="faqs" id="faq">
        <h2>FAQs</h2>
      <Accordion atomic={true}>

        <AccordionItem title="How long do I need to stake for?">
          <DummyContentOne />
        </AccordionItem>

        <AccordionItem title="Does everyone get an NFT for staking?">
          <DummyContentTwo />
